import { React, useState, useEffect } from "react";

const DarkMode = () => {
    const [dark, setDark] = useState(false);

    useEffect(() => {
        dark ? setDark(false) : setDark(true);
    });
    // const darkToggler = () => {
    //     dark ? setDark(false) : setDark(true);
    // };
    return dark;
};

export default DarkMode;
